import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {
  return (
    <ul>
      <li>Do something</li>
      <li>Do something else</li>
    </ul>
  );
}

const AppHeader = () => {
  return (
    <h3>List of deals</h3>
  );
}

const SearchPanel = () => {
  return (
    <input placeholder = 'search' />
  );
}

const elem = (
  <div>
    <AppHeader />
    <SearchPanel />
    <TodoList />
  </div>
);


ReactDOM.render(elem, document.getElementById('root'));
